import React, { useEffect, useState } from 'react'
import CheckOutSummery from './CheckOutSummery'

const CheckOut = (props) => {
   
    const [ingrediant, setIgrediant] = useState({})
    useEffect(() => {

        setIgrediant({ salad: 1, bacon: 2, meat: 1 })
    }
        , [])
   
    return (
        <div>
            
            <CheckOutSummery ingrediant={props.ingrediant}/>

        </div>
    )
}

 export default CheckOut
